import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  componentDidMount(){
    fetch('https://api.nal.usda.gov/ndb/reports/?ndbno=01009&type=f&format=json&api_key=DEMO_KEY')
    .then(resp=>resp.json())
    .then(console.log)
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>USDA</h1>
        </header>
        <main>
          <div className="display"></div>
        </main>
      </div>
    );
  }
}

export default App;
